import API from 'lib/api/call';
import getConfig from 'next/config';
import { ILatlng } from 'components/specific/addressField';
import { EateryTypes } from 'stores';
import axios from 'axios';

export interface IGetLatLngFromAddress {
  address: string;
}

export interface IGetResultsFromLatlng {
  latlng: ILatlng;
  type: EateryTypes;
  rating: number;
  minPrice: number;
  maxPrice: number;
  radius: number;
}

const { publicRuntimeConfig } = getConfig();
const GOOGLE_APIKEY: string = publicRuntimeConfig.BGOOGLE_APIKEY || '';
const baseURL: string = publicRuntimeConfig.BASE_URL || '';

const getLatLngFromAddress = async (queries: IGetLatLngFromAddress): Promise<any> => {
  // const params = new contracts.GetLatLngFromAddress.Params();
  // const queries = new contracts.GetLatLngFromAddress.Queries();
  // const body = new contracts.GetLatLngFromAddress.Body();
  // queries.address = `${p.address} Singapore`;
  // queries.key = apiKey;
  // const response = await API.call<contracts.GetLatLngFromAddress.Response>(req);
  // return await axios.get('http://localhost:3000/api/googleConsole');
  // const geocodeURI = `https://maps.googleapis.com/maps/api/geocode/json?address=${address} Singapore&key=${apiKey}`;
  console.log('in here');
  const response = await API.get('/api/googleConsole', null, queries, null);
};

const GoogleConsoleAPI = async (queries: IGetLatLngFromAddress) => {
  return await getLatLngFromAddress(queries);
};

const generateURL = (url: string, params?: any, queries?: any): string => {
  let finalURL = url;

  if (params) {
    const paramKeys = Object.getOwnPropertyNames(params);
    for (const p of paramKeys) {
      finalURL = finalURL.replace(`:${p}`, params[p]);
    }
  }

  if (queries) {
    const queryKeys = Object.getOwnPropertyNames(queries);
    const cleanedQueries = queryKeys.filter((k: string) => {
      return queries[k] !== undefined && queries[k] !== null;
    });

    if (0 === cleanedQueries.length) {
      return finalURL;
    }

    finalURL += '?';
    for (const q of cleanedQueries) {
      finalURL += `${q}=${queries[q]}&`;
    }
  }

  return finalURL.slice(0, -1);
};

export default GoogleConsoleAPI;
